def naive_suffix(s):
    return [t[1] for t in sorted((s[i:],i) for i in range(len(s)))]

def randomString(stringLength=10):
    """Generate a random string of fixed length """
    letters = string.ascii_lowercase
    return ''.join(random.choice(letters) for i in range(stringLength))

def arrayEQ(test,expect,strs):
    if len(test) != len(expect):
        print(strs)
        print(str(test) + ' is not eq to ' + '\n' +str(expect))
        raise ('F Wrong!')
    for i in range(len(test)):
        if test[i] != expect[i]:
            print(strs)
            print(str(test) + ' is not eq to ' + '\n' + str(expect))
            raise('F Wrong!')
    return True

def matrixEQ(test,expect,strs):
    if len(test) != len(expect):
        print(strs)
        print(str(test) + ' is not eq to ' + '\n' +str(expect))
        raise ('F Wrong!')
    for i in range(len(test)):
        if test[i][0] != expect[i][0]:
            print(strs)
            print(str(test) + ' is not eq to ' + '\n' + str(expect))
            raise('F Wrong!')
        if test[i][1] != expect[i][1]:
            print(strs)
            print(str(test) + ' is not eq to ' + '\n' + str(expect))
            raise('F Wrong!')
    return True

def longestCommonPrefix(a):
    size = len(a)
    if (size == 0):
        return 0
    if (size == 1):
        return len(a[0])
    a.sort()
    end = min(len(a[0]), len(a[size - 1]))
    i = 0
    while (i < end and
           a[0][i] == a[size - 1][i]):
        i += 1
    pre = a[0][0: i]
    return len(pre)

def brute_pair(func1,func2,strs,strLength):
    for k in range(strLength):
        for j in range(k + 1, strLength):
            tesVal = [func1(k, j)]
            expect = [func2([strs[k:strLength], strs[j:strLength]])]
            arrayEQ(tesVal, expect, strs)

def brutewildCardmatch(txt, pat):
    M = len(pat)
    N = len(txt)
    memo = [0 for i in range(N)]
    for i in range(N - M + 1):
        j = 0
        while (j < M):
            if pat[j] == '?' or (txt[i + j] == pat[j]) :
                j += 1
            else:
                break
        if (j == M):
            memo[i] = 1
    return memo

