    def test_longest_prefix(self):

        strLength = 20
        for i in range(7000):
            strs = randomString(strLength)
            test = SuffixTree()
            test.build(strs+'$')
            brute_pair(test.longestprefix,longestCommonPrefix,strs,strLength)

        strs = 'aaaab'
        test = SuffixTree()
        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))
        strs = 'aaaaa'
