        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))
        strs = 'TTTTTTTTTTTTTTT'
        test = SuffixTree()
        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))
        strs = 'abcdefghij'
        test = SuffixTree()
        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))
        strs = 'aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa'
        test = SuffixTree()
        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))
        strs = ''
        test = SuffixTree()
        test.build(strs + '$')
        brute_pair(test.longestprefix, longestCommonPrefix, strs, len(strs))

